import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Layout from "./components/Layout/Layout";
import PaymentComponent from "./components/Payment/Payment.jsx";
import BookingComponent from "./components/Booking/Booking.jsx";  // Assuming you have a Booking component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />} />
        <Route path="/booking" element={<BookingComponent />} />  {/* Booking Page */}
        <Route path="/payment" element={<PaymentComponent />} />  {/* Payment Page */}
      </Routes>
    </Router>
  );
}

export default App;
